def process_data_with_ascii(hex_data):
    import re
    
    result_hex = []
    
    # Define a regular expression to identify hex values in brackets [0x..] and ASCII characters
    pattern = r"\[0x[0-9A-Fa-f]{2}\]|[^[]"
    
    # Iterate through all matches
    for match in re.finditer(pattern, hex_data):
        token = match.group(0)
        if token.startswith("[0x"):  # Handle hex values in brackets
            hex_value = token[1:-1]  # Remove the brackets
            result_hex.append(hex_value)
        else:  # Handle ASCII characters
            for char in token:  # Convert each ASCII character to its hex equivalent
                result_hex.append(f"{ord(char):02X}")
    
    # Join the results into a single hexadecimal string
    return "".join(result_hex)


